  `fileId` bigint(20) NOT NULL COMMENT '导入时所在Excel表的编号',
  `channel_num` bigint(20) NOT NULL COMMENT '渠道编号',
  `channel_product` varchar(16) NOT NULL COMMENT '渠道产品',
  `asset_id` bigint(20) DEFAULT NULL COMMENT '资产编号',
  `type` smallint(2) NOT NULL DEFAULT '1' COMMENT '默认1为企业，2为个人',
  `enterprise_borrower_name` varchar(32) DEFAULT NULL COMMENT '企业名称',
  `registered_capital` decimal(20,0) DEFAULT NULL COMMENT '注册资金',
  `registered_address` varchar(128) DEFAULT NULL COMMENT '注册地址',
  `founding_time` date DEFAULT NULL COMMENT '成立日期',
  `corporation` varchar(16) DEFAULT NULL COMMENT '法人姓名',
  `asset_type` smallint(2) DEFAULT NULL COMMENT '资产类型',
  `raise_date` date DEFAULT NULL COMMENT '募集日期，传送到笑脸平台的日期',
  `borrower_name` varchar(32) DEFAULT NULL COMMENT '借款人姓名',
  `borrower_phone` varchar(16) DEFAULT NULL COMMENT '借款人电话',
  `borrower_idcard` varchar(32) DEFAULT NULL COMMENT '借款人证件号码',
  `borrower_birthday` date DEFAULT NULL COMMENT '借款人出生日期，格式：yyyy-MM-dd',
  `borrower_address` varchar(128) DEFAULT NULL COMMENT '居住地址',
  `borrower_company` varchar(32) DEFAULT NULL COMMENT '工作单位',
  `borrower_idcard_front_url` varchar(255) DEFAULT NULL COMMENT '身份证正面照片URL',
  `borrower_idcard_back_url` varchar(255) DEFAULT NULL COMMENT '身份证反面照片URL',
  `borrower_idcard_hold_url` varchar(255) DEFAULT NULL COMMENT '手持身份证照片URL',
  `borrow_use_type` smallint(2) DEFAULT NULL COMMENT '借款用途 (0:其他借款，1:短期周转，2:购房借款，3:购车借款，4:装修借款，5:投资创业，6:个人消费 )',
  `borrower_education` varchar(16) DEFAULT NULL COMMENT '借款人学历',
  `borrower_is_married` smallint(2) DEFAULT NULL COMMENT '婚姻状况（0:未婚，1：已婚）',
  `zipcode` int(8) DEFAULT NULL COMMENT '邮政编码',
  `borrower_position` varchar(32) DEFAULT NULL COMMENT '所属职业及职位',
  `borrower_income` int(10) DEFAULT NULL COMMENT '收入情况',
  `is_fixed_assets` smallint(2) DEFAULT NULL COMMENT '是否有固定资产（0:无，1:有）',
  `borrower_email` varchar(64) DEFAULT NULL COMMENT '电子邮箱',
  `description` varchar(512) DEFAULT NULL COMMENT '资产方审核／评价结果',
  `credit_amount` decimal(20,0) DEFAULT NULL COMMENT '授信额度，单位元，精确到分',
  `is_follow_up` decimal(20,0) DEFAULT NULL COMMENT '接续资产',
  `bank_cardNo` int(16) DEFAULT NULL COMMENT '银行卡号',
  `risk_lv` smallint(2) DEFAULT NULL COMMENT '信用等级',
  `release_type` smallint(2) DEFAULT NULL COMMENT '放款类型（1:个人，2:商户，3:企业），默认为商户',
  `borrower_idtype` smallint(2) DEFAULT NULL COMMENT '证件类型',
  `borrower_bank_code` varchar(10) DEFAULT NULL COMMENT '银行编码',
  `borrower_card_number` varchar(16) DEFAULT NULL COMMENT '银行卡号',
  `borrower_bank_phone` varchar(16) DEFAULT NULL COMMENT '银行预留手机号',
  `borrower_bank_province` varchar(16) DEFAULT NULL COMMENT '开户行所在省',
  `borrower_bank_city` varchar(16) DEFAULT NULL COMMENT '开户行所在市',
  `borrower_bank_subbranch` varchar(32) DEFAULT NULL COMMENT '分支行名称',
  `plan_date` smallint(2) DEFAULT NULL COMMENT '固定还款日，10、20、28等',
  `order_no` bigint(20) DEFAULT NULL COMMENT '订单ID',
  `createTime` date NOT NULL,
  `modifyTime` date NOT NULL,
  PRIMARY KEY (`enterprise_info_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

