DROP TABLE IF EXISTS `launch_form`;
CREATE TABLE `launch_form` (
  `form_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '上线工单id',
  `project_id` bigint(20) NOT NULL COMMENT '项目编号',
  `test_form_id` bigint(20) unsigned NOT NULL COMMENT '测试工单id',
  `form_content` text NOT NULL COMMENT '上线内容',
  `create_user` bigint(20) NOT NULL COMMENT '创建人员',
  `create_username` varchar(32) NOT NULL COMMENT '创建人员姓名',
  `accept_develop_user` bigint(20) DEFAULT NULL COMMENT '接单开发人员',
  `accept_develop_username` varchar(32) DEFAULT NULL COMMENT '接受开发人员姓名',
  `accept_test_user` bigint(20) unsigned DEFAULT NULL COMMENT '接单测试人员',
  `accept_test_username` varchar(32) DEFAULT NULL COMMENT '接单测试人员姓名',
  `operations_user` bigint(20) DEFAULT NULL COMMENT '运维人员userId',
  `operations_username` varchar(32) DEFAULT NULL COMMENT '运维人员姓名',
  `form_status` int(2) NOT NULL DEFAULT '0' COMMENT '0：待上线（测试人员创建上线工单）    1：待重新上线（出现Bug回滚到此状态）    2：已接单（运维接单）    3：上线完成待验证（运维部署完成确认）    4：开发验证中（开发人员验证上线结果）    5：开发验证未通过（开发打回给运维）    6：开发验证通过（开发验证上线结果完成）    7：测试验证中（测试人员验证上线结果）    8：测试验证未通过（测试打回给运维）    9：测试验证通过（测试验证上线结果完成）    10：运维关闭工单（上线工单完成）',
  `note` varchar(512) DEFAULT NULL COMMENT '备注',
  `gmt_create` bigint(32) NOT NULL COMMENT '创建时间',
  `gmt_modify` bigint(32) NOT NULL COMMENT '修改时间',
  PRIMARY KEY (`form_id`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of launch_form
-- ----------------------------

-- ----------------------------
-- Table structure for load
-- ----------------------------
DROP TABLE IF EXISTS `load`;
CREATE TABLE `load` (
  `asset_id` int(10) NOT NULL COMMENT '标的记录号',
  `fileId` bigint(20) NOT NULL COMMENT '标的导入前所在Excel文件编号',
  `channel_id` bigint(20) NOT NULL COMMENT '对应企业表编号',
  `amount` decimal(20,0) NOT NULL COMMENT '借款金额',
  `borrow_rate` smallint(5) NOT NULL COMMENT '借款利率',
  `term_unit` smallint(2) NOT NULL COMMENT '还款期限单位(1：天、2：周、3：月、4：年 ) ,如：期限为天，传值：1；期限为月，传值：3',
  `term_count` smallint(5) NOT NULL COMMENT '还款期限，配合还款周期单位(term_unit)和产品类型（product_type）使用',
  `product_type` smallint(2) NOT NULL COMMENT '产品类型（1:按期付息、2:一次性还本付息、3、等额本息、4、等本等息），如为等额本息产品，传值：3',
  `interest_type` smallint(2) NOT NULL COMMENT '计息方式（1：固定起息，2：非固定起息），若放款成功当天开始计息，传值：2',
  `start_interest_date` date DEFAULT NULL COMMENT '起息日',
  `fee_type` smallint(2) NOT NULL COMMENT '收费类型（1:收砍头息，2：不收砍头息）',
  `cut_rate` decimal(20,0) NOT NULL COMMENT '配合收费类型（fee_type）使用，若：收费类型 = 1，则必填，砍头息率格式同借款利率（borrow_rate），即：砍头息率2.002%，则传值：2.002',
  `borrower_channel` varchar(32) NOT NULL COMMENT '底层借款渠道，自营产品可以传产品名称，非自营产品可以传产品名称或合作商户名称等，用于资产分类使用',
  `down_paryment` decimal(20,0) DEFAULT NULL COMMENT '首付金额，非必填',
  `term_num` smallint(5) NOT NULL COMMENT '已还期数，无已还则传值：0',
  `already_repayment` decimal(20,0) NOT NULL COMMENT '已还总额，无已还则传值：0',
  `surplus_repayment` decimal(20,0) NOT NULL COMMENT '剩余应还总额，无则传值：0',
  `contract_sign_date` date NOT NULL COMMENT '借款下单日期，格式为：yyyy-MM-dd HHSS,如：2017-08-01 00:00:00',
  `status` smallint(2) NOT NULL DEFAULT '1' COMMENT '标的状态，默认为1已经过清洗但还未推送，2为推送',
  `submitTime` date DEFAULT NULL COMMENT '标的提交推送时间',
  `createTime` date NOT NULL,
  `modifyTime` date NOT NULL,
  PRIMARY KEY (`asset_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of load
-- ----------------------------

